import React from "react";

import {List, Datagrid,TextField, SearchInput,Filter} from 'react-admin';


const OrganizationFilter = (props) =>(<Filter {... props}>
    <SearchInput placeholder="Organization Email" source="email" ressettable alwaysOn></SearchInput>
</Filter>


);



const OrganizationList = (props) => (

    <List {...props } filters ={<OrganizationFilter/>} >
    <Datagrid rowClick="edit">
    
            <TextField source="id" label="id"  />
    
            <TextField source="name" />
            <TextField source="email" />
            <TextField source="phone" />
            <TextField source="code" />
            <TextField source="taxes" />
            <TextField source="address" />
            <TextField source="founder" />
            <TextField source="account" />
    </Datagrid>
</List>

);
    

        

    


export default OrganizationList;
